import React, { Component } from 'react';
import './App.css';
import ShoppingApp from './components/ShoppingApp';



class App extends Component {
  constructor(props){
    super(props);
    this.shoppinglist = [];
  }
  render() {
    return (
      <ShoppingApp initItems={this.shoppinglist}/>
    );
  }
}

export default App;
